import { DocumentEditor } from '../../src/document-editor/document-editor';
import { createElement } from '@syncfusion/ej2-base';
import { Editor, TableCellWidget, TableRowWidget, TableWidget } from '../../src/index';
import { TestHelper } from '../test-helper.spec';
import { Selection } from '../../src/index';
import { EditorHistory } from '../../src/document-editor/implementation/editor-history/editor-history';
import { SfdtExport } from '../../src/document-editor/implementation/writer/sfdt-export';
/**
 * undo/redo while deleting the table content
 */
let sfdtContent: any ='{"sfdt":""}';
describe('907928-undo not working when deleting table content in track changes mode', () => {
    let editor: DocumentEditor = undefined;
    let event: any;
    beforeAll((): void => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false });
        DocumentEditor.Inject(Editor, Selection, EditorHistory, SfdtExport); editor.enableEditorHistory = true;
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((done): void => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        setTimeout(function () {
            document.body.innerHTML = '';
            done();
        }, 1000);
    });
    it('undo/redo the table of content', () => {
        editor.open(sfdtContent);
        editor.enableTrackChanges=true;
        editor.selection.select('0;4;1;0;0;0','0;4;1;0;5;0');
        editor.editor.delete();
        expect(editor.revisions.length).toBe(1);
        //undo process
        editor.editorHistory.undo();
        expect(editor.revisions.length).toBe(0);
        //redo process
        editor.editorHistory.redo();
        expect(editor.revisions.length).toBe(1);
    });
   
});



